/**
 * Next.js generated .next/types/validator.ts can include imports to route modules
 * that do not exist anymore in the workspace (stale dev artifacts).
 *
 * This stub prevents tsc --noEmit from failing on TS2307 for that specific path.
 * Types only (no runtime impact).
 */
declare module "../../src/app/(admin)/admin/forms/[id]/builder/page.js" {
  const mod: unknown;
  export default mod;
}
